var content = document.getElementsByClassName("content");
var reset = document.querySelector("#reset");
var next = document.querySelector("#next");
var pre = document.querySelector("#pre");
var instructionalStep = 2;
var submitButton = document.querySelector("#gen");
var inputs;

// console.log(currentStep());
activate(content[0]);

function currentStep(){
	for(var i = 0;i < content.length;i++){
		if(!content[i].classList.contains("disabled")){
			return i;
		}
	}
}

function activate(element){
	document.body.scrollTop = 0; // For Safari
    document.documentElement.scrollTop = 0; // For Chrome, Firefox, IE and Opera
	for(var i = 0;i < content.length;i++){
		content[i].classList.add("disabled");
	}
	element.classList.remove("disabled");

	if(currentStep() == content.length - 1){
		submitButton.classList.remove("disabled");
	}
}

reset.addEventListener("click", function(){
	var inputs = document.querySelectorAll(".inputs");
	for(var i = 0;i < inputs.length;i++) inputs[i].value = "";
	activate(content[0]);
	next.innerHTML = "NEXT";
	submitButton.classList.add("disabled");
});

pre.addEventListener("click", function(){
	var c = currentStep();
	if(c > 0) activate(content[c - 1]);
	next.innerHTML = "NEXT";
	submitButton.classList.add("disabled");
});

next.addEventListener("click", function(){
	if(currentStep() == instructionalStep) {
		var radios = content[currentStep()].querySelectorAll(".form-check-input");
		var flag = false;
		var is = 0;
		for(var i = 0;i < radios.length;i++){
			if(radios[i].checked) {
				flag = true;
				is = i;
			}
		}
		if(!flag){
			alert("Please select an instructional Strategy.");
			return;
		}
		else{
			inputs = content[currentStep()].querySelectorAll(".isinput")[is];
			inputs = inputs.querySelectorAll(".form-control");
		}
	} 
	else inputs = content[currentStep()].querySelectorAll(".inputs");
	for(var i = 0;i < inputs.length;i++){
		if(inputs[i].value == ""){
			alert("Please fill in all required fields.");
			return;
		}
	}
	var c = currentStep() + 1;
	if(c < content.length) {
		activate(content[c]);
	}
	
});

function toggleIs(){
	document.body.scrollTop = 0; // For Safari
    document.documentElement.scrollTop = 0; // For Chrome, Firefox, IE and Opera
	var inputs = document.querySelectorAll(".isinput");
	var outlines = content[currentStep()].querySelectorAll(".outline");
	var media = content[currentStep()].querySelectorAll(".media");
	var radios = content[currentStep()].querySelectorAll(".form-check-input");
	var strats = content[currentStep()].querySelectorAll(".strat");
	for(var i = 0;i < radios.length;i++){
		if(radios[i].checked){
			inputs[i].classList.remove("disabled");
			outlines[i].classList.remove("disabled");
			media[i].classList.remove("disabled");
			strats[i].classList.remove("disabled");
		}
		else{
			inputs[i].classList.add("disabled");
			outlines[i].classList.add("disabled");
			media[i].classList.add("disabled");
			strats[i].classList.add("disabled");
		}
	}
	$("#intro").collapse('hide');
}

